        <div className="profile-page">
            <div className="user-details">
                Is this working?
                <h3>{props.currentUser.username}</h3>
                <h3>{props.currentUser.email}</h3>
            </div>
            <div className="user-wine-list">
                {props.wines.map()}
                <h2>Wine List</h2>
                <p>{props.wine}</p>
            </div>

        </div>
    )
}
